import React from 'react';
import '../styles/about.css';

export default function About() {
  return (
    <section id="about" className="about-section card">
      <div className="section-header">
        <h2 className="section-title">Priya Dharshini S</h2>
        <p className="section-subtitle">Full-Stack Web & Mobile App Developer</p>
      </div>
      <p className="about-description">
        Passionate about building clean, scalable, and user-friendly applications with a focus on UI/UX and the MERN stack.
      </p>
    </section>
  );
}
